import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Timeset from './timeset';

class App extends Component {
  logProps() {
    const pps = document.getElementsByTagName("timeset")[0].TimeGap;
    console.log(pps);
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Timeset className="timeset" TimeGap="" StartTime=""/>
          <p></p>
        </header>
      </div>
    );
  }
}

export default App;
